INSERT INTO `contents` (`id`, `name`, `value`, `img_1`, `img_2`, `img_3`, `img_4`, `created_at`, `updated_at`) VALUES
(1, 'about_us', '<p>\r\n\r\n<i><b></b>Beach combers is a beach resorts/services promoting platform powered by Pignus Technologies, in partnership with Beach Combers Club, a Non Governmental Organization&nbsp;(NGO), to promote beach tourism in Nigeria.</i></p><p><i>The club was incorporated on the  30th October, 2020 with Seven trustees.</i></p><p><i><br></i></p><blockquote><blockquote><blockquote><p><i><b><u>Our objectives includes the following</u></b></i></p></blockquote></blockquote></blockquote><ul><li><i><b>To promote beach and boat tourism in Lagos state</b></i></li><li><i><b>To promote beach leisure, beach sports and water sports amongst the Lagos state populace</b></i></li></ul><ul><li><i><b>To promote charity and charitable donations in line with the objectives of the club.</b></i></li></ul><ul><li><i><b>To carry out the business of a bona-fide Membersâ€™ Club providing the means of social activity, mutual helpfulness, mental and moral improvement, recreation, and other advantages of a Club.</b></i></li></ul>\r\n\r\n<br><p></p>', '', '', '', '', '2021-06-08 00:00:46', '2021-08-03 12:45:20'),
(2, 'contact_us', NULL, NULL, NULL, NULL, NULL, '2021-06-08 00:01:06', '2021-06-08 00:01:06'),
(3, 'what_we_do', '<p>We are an online directory that promotes beach tourism and events with the use of beach soccer and some other form of beach activities and we also market resorts nationwide, alongside boat and yacht cruise.</p>', '', '', '', '', '2021-06-08 00:01:36', '2021-08-05 15:26:38'),
(4, 'reminiscent_moment', '<p>\r\n\r\nWhen dreaming about the best yacht wedding reception or party that cannot be forgotten or the best moment you can ever have in swimming pool, then think about us.\r\n\r\n<br></p>', '', '', '', '', '2021-06-08 00:01:52', '2021-06-15 13:27:23'),
(5, 'beach_therapy', '<p>\r\n\r\nWe offer all manners of therapeutic exercise and gymnastics in a very conducive atmosphere. \r\n\r\n<br></p>', '', '', '', '', '2021-06-08 00:02:17', '2021-06-15 13:27:51'),
(6, 'midtown_attractions', NULL, NULL, NULL, NULL, NULL, '2021-06-08 00:02:33', '2021-06-08 00:02:33'),
(7, 'unforgettable_views', NULL, NULL, NULL, NULL, NULL, '2021-06-08 00:02:48', '2021-06-08 00:02:48'),
(8, 'beach_tourism', '<p>\r\n\r\nWe organize both  local and international beach tourism for our exclusive clients.\r\n\r\n<br></p>', '', '', '', '', '2021-06-08 00:03:02', '2021-06-08 00:05:04'),
(9, 'boat_and_yacht_cruise', '<p>\r\n\r\nGet your best cruising experience with our boat and yacht party cruise. Also, with a mid sea yacht wedding reception.<br></p>', '', '', '', '', '2021-06-08 00:03:17', '2021-06-08 00:05:41'),
(10, 'beach_hangout', '<p>\r\n\r\nEnjoy our beach front hangout and relaxation spots with an exclusive musical moment.<br></p>', '', '', '', '', '2021-06-08 00:03:33', '2021-06-08 00:06:31'),
(11, 'beach_sports', '<p>\r\n\r\nBe a part of our community beach sport competitions, covering every area of beach sport events such as:  Beach Football, Sand Soccer, Beach Basketball, Beach  Rugby.\r\n\r\n<br></p>', '', '', '', '', '2021-06-08 00:03:49', '2021-06-08 00:07:22'),
(12, 'membership_signup', NULL, NULL, NULL, NULL, NULL, '2021-06-08 00:04:04', '2021-06-08 00:04:04'),
(13, 'membership_terms', '<p>We are the best of our kind you should agree to our terms and condition. Ensure you have registered</p>', '', '', '', '', '2021-07-29 14:36:34', '2021-08-16 20:56:34');

